CREATE TABLE sys.system_internals_partition_columns
(
    partition_id bigint NOT NULL,
    partition_column_id int NOT NULL,
    modified_count bigint NOT NULL,
    max_inrow_length smallint,
    is_replicated bit,
    is_logged_for_replication bit,
    is_dropped bit,
    system_type_id tinyint,
    max_length smallint,
    precision tinyint,
    scale tinyint,
    collation_name sysname,
    is_filestream bit,
    key_ordinal smallint NOT NULL,
    is_nullable bit,
    is_descending_key bit,
    is_uniqueifier bit,
    leaf_offset smallint,
    internal_offset smallint,
    leaf_bit_position tinyint,
    internal_bit_position tinyint,
    leaf_null_bit smallint,
    internal_null_bit smallint,
    is_anti_matter bit,
    partition_column_guid uniqueidentifier,
    is_sparse bit
);
